import React, { Component } from "react";

class Dashboard extends Component {

  getDatafiles() {
    fetch(
      "http://20.191.211.229:5000/v1/datafiles/bb1ba6fb-d579-11eb-b498-000d3acc2c10/metadata",
      {
        method: "GET",
        headers: {
          "Content-Type": "application/json"
        }
      }
    )
      .then(res => {
        return res.json();
      })
      .then(data => {
        console.log(data);
      });
  }

  render() {
    return <h1>{getDatafiles}</h1>;
  }
}

export default Dashboard;
